import logo from './logo.svg';
import './App.css';
import {Data} from './data.js';



function App() {

  return (
    <div className="box">
      <div className="list-ytb">
      {Data.map((item, index)=> {
        <Future
          key={item.id}
          img={item.img}
          avt={item.avt}
          titile={item.titile}
          des={item.des}
        >
        </Future>
      })}
    </div>
    </div>
  );
}

export default App;
